import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import { Category, ChartComponent, ColumnSeries, Inject, Legend, LineSeries, SeriesCollectionDirective, SeriesDirective, Tooltip } from '@syncfusion/ej2-react-charts';

class Charts extends Component {

    constructor(props){
        super(props);

        // initiiere einen leeren state
        this.state = {
          data: [],
          legendSettings: { visible: true },
          primaryxAxis: { valueType: 'Category' },

            showRunDialog: false,

            loadingInProgress: false,
            error: null
        };
    }

    componentDidMount() {
      this.setState({

      })
    }

    render(){
          const { runDate, task1Duration, task2Duration, task2WrongTiles, task2AdurationTiletoTile, task3Duration, task3WrongAssignment } = this.state;
          return (
            <ChartComponent id="charts" primaryXAxis={this.state.primaryxAxis} legendSettings={this.state.legendSettings}>
            <Inject services={[ColumnSeries, Tooltip, Legend, LineSeries, Category]}/>
            <SeriesCollectionDirective>
              <SeriesDirective dataSource={this.state.data} xName='month' yName='sales' name='Sales'/>
            </SeriesCollectionDirective>
              </ChartComponent>
          );
        }
}

export default Charts;
